DROP TABLE IF EXISTS cishfid.bic_type;

DROP SEQUENCE IF EXISTS cishfid.bic_type_id_seq;

CREATE SEQUENCE IF NOT EXISTS cishfid.bic_type_id_seq
    INCREMENT 1
    START 1
    MINVALUE 1
    MAXVALUE 9223372036854775807
    CACHE 250;

create table cishfid.bic_type
(
    id bigint NOT NULL,
    stm_tp_cd           	  	text,
    cmpny_tp_cd               	integer,
    src_tbl_no            	  	text,
    src_tbl_nme           		text,
    src_cat               		text,
    indstry_src_tp_cd     		integer,
	indstry_src_tp_desc   		text,
    indstry_src_tp_sub_desc		text,
    tbl_nme               		text,
    indstry_entps_tp_cd   		integer,
	indstry_spl_entps_tp_desc	text,
    indstry_entps_tp_desc 		text,
	indstry_entps_tp_sub_desc 	text,
    indstry_cat_tp_id     		integer,
    indstry_tp_efctv_dt   		text,
    indstry_tp_expry_dt   		text,
    CONSTRAINT bic_type_pkey PRIMARY KEY (id)
);


commit;